    n = int(stdin)
    points = []
    for _ in range(n):
        x, y = map(int, input().split())
        points.append((x, y))

    def is_adjacent(p1, p2):
        return abs(p1[0] - p2[0]) + abs(p1[1] - p2[1]) <= 1

    def visit_level(points, level):
        level_points = [p for p in points if max(p[0], p[1]) == level]
        return sorted(level_points, key=lambda x: x[1])

    def distance(p1, p2):
        return abs(p1[0] - p2[0]) + abs(p1[1] - p2[1])

    def dfs(points, visited, current_level, total_distance):
        if len(visited) == n:
            return total_distance

        level_points = visit_level(points, current_level)
        for p in level_points:
            if p not in visited:
                for p2 in points:
                    if is_adjacent(p, p2) and p2 not in visited:
                        visited.add(p)
                        total_distance += distance(p, p2)
                        dfs(points, visited, current_level, total_distance)
                        visited.remove(p)
                        total_distance -= distance(p, p2)

    level = 1
    while True:
        level_points = visit_level(points, level)
        if level_points:
            break
        level += 1

    dfs(points, set(), level, 0)

