    A = list(map(int, stdin.split()[1:]))

    # Create a graph where the nodes are the people and the edges represent the constraints
    graph = [[] for _ in range(N)]
    for i in range(N):
        left_constraint = abs(i - A[i])
        right_constraint = (N - 1 - i) - A[i]
        if left_constraint > 0:
            graph[i].append((i - left_constraint) % N)
        if right_constraint > 0:
            graph[i].append((i + right_constraint) % N)

    # Find the number of the possible orders
    possible_orders = 0
    for i in range(N):
        if not graph[i]:
            possible_orders += 1
        else:
            break
    if possible_orders == 0:
        return "0"

    mod = 10**9 + 7
    # Calculate the factorials of the possible orders
    factorials = [1] * (possible_orders + 1)
    for i in range(1, possible_orders + 1):
        factorials[i] = (factorials[i - 1] * i) % mod

    # Calculate the C(N, possible_orders)
    C_N_possible_orders = 1
    for i in range(1, possible_orders + 1):
        C_N_possible_orders = (C_N_possible_orders * i) % mod

    # Calculate the number of combinations that satisfy the constraints
    combinations = 1
    for i in range(possible_orders):
        combinations = (combinations * factorials[i + 1]) % mod

    # Calculate the result
    result = (C_N_possible_orders * combinations) % mod

    return str(result)


