        count = 0
        for i in range(1, len(card_numbers) + 1):
            count += combination(len(card_numbers) - 1, i - 1)
        return count

    def count_strictly_ascending_sequences(card_numbers, K):
        if K == 1:
            return 1
        elif K == 2:
            return 1
        else:
            return count_strictly_ascending_sequences(card_numbers, K - 1) * len(card_numbers)

    def count_strictly_descending_sequences(card_numbers, K):
        if K == 1:
            return 1
        else:
