    key = ''.join(set(key.replace(' ', '')))

    # Fill the rest of the table with the remaining letters of the alphabet
    for letter in 'abcdefghijklmnopqrstuvwxyz':
        if letter not in key:
            key += letter

    # Create the encryption key table
    key_table = [key[i:i+5] for i in range(0, 25, 5)]

    # Encrypt the text
    encrypted_text = ''
    for i in range(0, len(text), 2):
        if i == len(text) - 1:
            if text[i] == 'x':
                encrypted_text += 'X'
            else:
                encrypted_text += text[i].upper()
            break
        if text[i] == 'x' and text[i+1] == 'x':
            encrypted_text += 'X'
            continue
        pair = text[i:i+2]
        for j, letter in enumerate(pair):
            row, col = key_table.index(letter.upper()), key_table[0].index(letter.upper())
            if j == 0:
                if letter.upper() == pair[1].upper():
                    encrypted_text += 'X'
                elif row == col:
                    encrypted_text += key_table[row][row]
                    key_table[row].pop(row)
                    key_table[row].append(key_table[row][0])
                elif row == 4:
                    encrypted_text += key_table[row][0]
                else:
                    encrypted_text += key_table[row+1][col]
            else:
